import { Card, CardImg,  CardHeader, CardBody, CardText,Row,Col, Button } from "reactstrap";
import { connect } from "react-redux";
import { Redirect } from "react-router-dom";
const Resource = ({
  title,
  content,
  category,
  rating,resource}) => {
      return(
      
    <div className="col mb-4">
     
      
      <Card className="h-100">
        <CardHeader>
          {title}
        </CardHeader>

        <CardBody >
          <a class="activator waves-effect waves-light mr-4"/>
        <CardText>
            {content}
          </CardText>
          <CardText>
            {category}
          </CardText>
          <CardText>{rating}</CardText>
          
         
        </CardBody>
      </Card>
    
     
    </div>
  
      )

};
